import React from 'react';

const WinnersBlock = ({winnersList}) => {
    return (
        <div>
            {winnersList.map((winner)=>(
                <div>
                    <div>{winner.name}</div>
                    <div>{winner.playerScore}</div>
                </div>
            ))}
        </div>
    );
};

export default WinnersBlock;
